import '../App.css';
import React,{useState} from "react"
import { getConnection } from '../JS/connection';




function SEARCHSTRING() {
const [txt,setTxt] = useState('');
const [resp,setResp] = useState('');
function getResponse (req) {
setResp(getConnection(req));
}

return (
    <div className="container">
            <div className={"lbl lead "} >ПОИСК</div>

                <input type="text" name="searchstr"
                placeholder={'Введите поисковый запрос'} 
                onChange={
                (e)=> {
                    setTxt(e.target.value)
                   e.target.value ? getResponse(e.target.value):'';
                }
                 
                }
                />

             <GETCARDS text={resp?resp:'Не найдено'}/>

  </div>
)
}


function GETCARDS(props) {
  return (
      <div className="cards">
          <div className="suggs">{ 
       '-------------------------------------------------'
              }</div>

          <div className="card">
              <div className="status "></div>


              <div className="reqv monospace">

                  &#9885;   {'ИНН 111111111 КПП 222222222  ОГРН 333333333333'}  &#9885;
              </div>
              <div className="orginfo">
                  <div className="orgname lead">
                      {'ПАО РОСТЕЛЕКОМ'}
                  </div>
                  <div className="orgform">
                      {'Головная организация'}
                  </div>

                  <div className="orgleader">
                      {'руководитель: Осеевский Михаил Эдуардович'}
                  </div>

                  <div className="orgaddress monospace lead">
                      {'г. Санкт-Петербург, вн.тер.г. муниципальный округ Смольнинское, наб Синопская, д. 14, литера А'}
                  </div>
                  <hr/>
              </div>
          </div>
          <div className="card">
              <div className="status "></div>


              <div className="reqv monospace">

                  &#9885;   {'ИНН 111111111 КПП 222222222  ОГРН 333333333333'}  &#9885;
              </div>
              <div className="orginfo">
                  <div className="orgname lead">
                      {'ПАО РОСТЕЛЕКОМ'}
                  </div>
                  <div className="orgform">
                      {'Головная организация'}
                  </div>

                  <div className="orgleader">
                      {'руководитель: Осеевский Михаил Эдуардович'}
                  </div>

                  <div className="orgaddress monospace lead">
                      {'г. Санкт-Петербург, вн.тер.г. муниципальный округ Смольнинское, наб Синопская, д. 14, литера А'}
                  </div>
                  <hr/>
              </div>
          </div>
<pre>{props.text}</pre>

      </div>
  )
}




    export default SEARCHSTRING;
